description:
The photographer Cauby moves and settles down in a small town in the countryside of Para. When he meets the model Lavinia, who is the wife of Pastor Ernani, they have a torrid love affair. Cauby asks Lavinia to leave her husband and the town with him but she refuses, Cauby does not know about the dishonored past of his muse and her gratitude to Ernani, who saved her from the streets and the drugs. Meanwhile, the snoopy and gossiper journalist Viktor Laurence receives compromising pictures of Lavinia naked, posing for Cauby. When Viktor and Ernani are found dead and Lavinia is missing, Cauby becomes the prime suspect of Sheriff Polozzi with tragic consequences for his life.



